 <v:textbox>
  <![if !mso]>
  <table cellpadding=0 cellspacing=0 width="100%">
   <tr>
    <td><![endif]>
    <div>
    <p class=MsoNormal align=center style='text-align:center'>América es el
    segundo continente más grande de la Tierra, después de Asia. Ocupa gran
    parte del hemisferio occidental del planeta. Se extiende desde el océano Ártico
    por el norte hasta las islas Diego Ramírez por el sur, en la confluencia de
    los océanos Atlántico y Pacífico, los cuales a su vez delimitan al
    continente por el este y el oeste, respectivamente.</p>
    <p class=MsoNormal align=center style='text-align:center'><o:p>&nbsp;</o:p></p>
    <p class=MsoNormal align=center style='text-align:center'>Con una
    superficie de más de 43 316 000 km², es la segunda masa de tierra más
    grande del globo (la primera es la parte no insular de <span class=SpellE>Eurafrasia</span>),
    cubriendo el 8 % de la superficie total del planeta y el 28.4 % de la
    tierra emergida, y además concentrando cerca del 12.5 % de la población
    humana. Las mayores aglomeraciones urbanas de América son Ciudad de México,
    Nueva York, São Paulo, Los Ángeles, Río de Janeiro, Buenos Aires, Lima y
    Bogotá.</p>
    </div>

   </tr>
  </table>
  <![endif]></v:textbox>

  <td colspan=9 align=left valign=top><img width=986 height=250
  src="oceania_archivos/image018.png"
  alt="Cuadro de texto: América es el segundo continente más grande de la Tierra, después de Asia. Ocupa gran parte del hemisferio occidental del planeta. Se extiende desde el océano Ártico por el norte hasta las islas Diego Ramírez por el sur, en la confluencia de los océanos Atlántico y Pacífico, los cuales a su vez delimitan al continente por el este y el oeste, respectivamente.&#13;&#10;&#13;&#10;Con una superficie de más de 43 316 000 km², es la segunda masa de tierra más grande del globo (la primera es la parte no insular de Eurafrasia), cubriendo el 8 % de la superficie total del planeta y el 28.4 % de la tierra emergida, y además concentrando cerca del 12.5 % de la población humana. Las mayores aglomeraciones urbanas de América son Ciudad de México, Nueva York, São Paulo, Los Ángeles, Río de Janeiro, Buenos Aires, Lima y Bogotá.&#13;&#10;"
